import React from 'react';
import footer from './footer.module.css'

function Footer() {
  return (
    <div className={footer.glav}>
    <div className={footer.glavF}>
    <div className={footer.glav1}>
    <div className={footer.glav11}></div>
    <div className={footer.glav12}></div>
    </div>
    <div className={footer.glav2}> f </div>
    <div className={footer.glav3}> g </div>
    <div className={footer.glav4}>  g</div>
    </div>
    <div className={footer.glavF2}>d</div>
    </div>
  );
}

export default Footer;
